import React from 'react'
import styled from 'styled-components'

const Signin = () => {
    return (
        <Body><div className='login_container'>



<div className='wp'>  <h>ashberry<br/></h>

<r>Welcome to ashberry</r>
<m>-here u can make your friends  with here highly complatabal <br/>
-meet with same  nature parter as your nature<br/></m></div>

<div className='si'><h2><br/><br/>dsfsdf</h2></div>


</div>


        </Body>
      

    )
}

const Body = styled.nav`


   background-image: url("https://webgradients.com/public/webgradients_png/002%20Night%20Fade.png"); 
   height:1321px;width:1349px;

h{
    font-size:54px;
    color:rgba(223,87,87,255);
}
r{
    color:white;
    font-size:44px;
}


.login_container{
    max-width: 1104px;
    height:500px;

    display:flex;
    
   
    margin:0 auto;
    
}


.si{
     background-color:gray;
     height:60vh;
     width:64vh;
    display:flex;
     flex-direction:column;
    // align-items:certer;
    
       
margin-right:264px
    // width: 600px;
    // height: 500px;
   
    
}
.wp{
    // display:flex;
margin-right:24px;
max-width: 500px;
}
`

export default Signin
